import React from 'react'
import '../App.css';
import {Link } from 'react-router-dom';
const Navbar = () => {
    return (
        <div className="Navbar">
            <div className="leftSide">
                <div className="links">
            <Link  to={{
                            pathname: "/customerProfile"
                            
                            }}><strong>Profile</strong></Link>
                </div>

            </div>
            <div className="rightSide">

            </div>
            
        </div>
    )
}

export default Navbar
